import './App.css';
import NavBar from './NavBar';
import { BrowserRouter, Routes, Route } from 'react-router-dom';





function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <NavBar />

        <Routes>
              <Route path="/" element={<h1>Producs Listing Components </h1>} />
              <Route path="/add-product" element={<h1>Add Producs Components </h1>} />
              <Route path="/update-product" element={<h1>Update Producs Components </h1>} />
              <Route path="/profile" element={<h1>Profile </h1>} />
              <Route path="/logout" element={<h1>Logout </h1>} />

        </Routes> 
      </BrowserRouter>

    </div>
  );
}

export default App;
